import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Footer from './components/Footer';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Header/>
       <Routes>
        <Route path='/' element/>
       </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
